import React from 'react';
import { 
    Grid, 
    TextField,
    InputAdornment,
    Input,
} from '@material-ui/core';
import { AccountCircle } from '@material-ui/icons';
import './Login.css'

function Login(){
    return (
        <>
            <Grid container className="main">
                <Grid item xs={3}>
                    <form className="root">
                        <TextField
                            // variant="outlined" 
                            label="Email" 
                            id="email" 
                            startAdornment={
                                <InputAdornment position="start">
                                    <AccountCircle />
                                </InputAdornment>
                            }
                        />
                    </form>
                </Grid>
            </Grid>
        </>
    );
}

export default Login;
